const lightModeDetails = () => {
    const _registrationH1 = document.querySelector('.registration h1');
    const _loginA = document.querySelector('.login a');

    _registrationH1.style.color = 'white';
    _loginA.style.color = 'black';
};

export { lightModeDetails };
